import styles from "../TransactionHistory/TransactionHistory.module.css";

export const TransactionHistory = ({ items }) => {
  return (<table className={styles.transaction__history}>
    <thead>
      <tr className={styles.table__cap}>
        <th>Type</th>
        <th>Amount</th>
        <th>Currency</th>
      </tr>
    </thead>
    <tbody>
      {items.map(({ id, type, amount, currency }) => (
          <tr key={id}>
            <td>{type}</td>
            <td>{amount}</td>
            <td>{currency}</td>
          </tr>
        )
      )}
    </tbody>
  </table>)
};
